import React from "react";

import "./SidebarButton.css";

const icon = (<>Hello</>);

const SidebarButton = ({ children }) => {
	console.log(icon)
	return (
		<div>
			{icon}
			<button className="sidebar-button">{children}</button>
		</div>
	);
};

export default SidebarButton;
